import axios from 'axios';

const fetchCameras = async () => {
    try {
        const response = await axios.get('/api/cameras');
        if (response.data && Array.isArray(response.data)) {
            return response.data;
        } else {
            console.error('Invalid response from server');
            return [];
        }
    } catch (error) {
        console.error(error);
        return [];
    }
}

export { fetchCameras };
